		//this.state = {applicants: [name: [], ... ]}; 
		//this.client = new Client();
		//this.client.clientResult().then(r =>this.setState({names:r}));
	}

  render(){
	let namesFromServer = ["Almir Omerovic","Ina Golos"];
	let applInfo1 = { 
			name: "Almir Omerovic",
			placeOfEmployment: "DCCS, Tuzla",
			addres: "Moluhe,7500 Tuzla",
			};
	let applInfo2 = { 
			name: "Ina Golos",
			placeOfEmployment: "CA, Tuzla",
			addres: "Stupine,7500 Tuzla",
			};
	let infos = [appInfo1,appInfo2];

	this.state.applicants = infos;
    return(
      <div id="mainListDiv">
        <p> Showing results in my app </p>
        {this.state.names.map(n => <p>{n}</p>)}
        <ApplicantInfo info={applInfo1}/>
      </div>
    );
  }
}

